import {Route,Routes} from 'Route-router-dom';
import './App.css';
import Login from './pages/Login';
import Signup from './pages/Signup'

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/login' element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
